import React from 'react';
import '../stylesheets/landing.scss';

const Landing = () => {
  const openKey = "{";
  const closeKey = "}";
  return (
  <div className="container">
      <pre>
        <p>public class <span className="hljs-title">Welcome</span> {openKey}</p>
        <p>public static void <span className="hljs-title">main</span>(String[] args) {openKey}</p>

        System.out.println(<span className="hljs-string">"Pulsa el bot√≥n ejecutar"</span>)
        {closeKey}
      {closeKey}
    </pre>
  </div>
  );
}

export default Landing;
